"use strict";$(document).ready((function(){var animateRowNext=function animateRowNext(row){var $lastImage=row.children("img").last();var $imageMargin=parseInt($lastImage.css("margin-right"));var $lastImageWidth=$lastImage.outerWidth(true);var $lastImageClone=$lastImage.clone();$lastImageClone.prependTo(row).css({marginLeft:$imageMargin,opacity:1});$lastImage.animate({marginRight:"-=".concat($lastImageWidth,"px")},1e3);setTimeout((function(){$lastImage.remove()}),1e3)};var animateRowPrev=function animateRowPrev(row){var $firstImage=row.children("img").first();var $imageMargin=parseInt($firstImage.css("margin-left"));var $firstImageWidth=$firstImage.outerWidth(true);var $firstImageClone=$firstImage.clone();$firstImageClone.appendTo(row).css({marginLeft:-$firstImageWidth+$imageMargin,opacity:0});$firstImageClone.animate({marginLeft:$imageMargin,opacity:0},500);$firstImageClone.animate({marginLeft:$imageMargin,opacity:1},500);setTimeout((function(){$firstImage.remove()}),1e3)};$(".next, .prev").on("click",(function(){$(".next, .prev").prop("disabled",true);var $button=$(this);var $upperRow=$(".upper-row");var $lowerRow=$(".lower-row");if($button.hasClass("next")){animateRowNext($upperRow);animateRowNext($lowerRow)}else if($button.hasClass("prev")){animateRowPrev($upperRow);animateRowPrev($lowerRow)}setTimeout((function(){$(".next, .prev").prop("disabled",false)}),1e3)}))}));